          '<span class="template_sbc"><b>Active:</b></span> <b>Warwick</b> <span style="white-space:pre; position:relative;" data-tip="Dash" class="glossary" data-game="lol"><a href="/wiki/Dash" title="Dash"><img src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" height="20" data-image-key="Dash.png" data-relevant="0" loading="lazy" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/5/55/Dash.png/revision/latest/scale-to-width-down/20?cb=20180514002826" decoding="async" class="lazyload" width="20" data-image-name="Dash.png" alt="Dash"></a> <a href="/wiki/Dash" title="Dash">leaps</a></span> in the target direction with <span data-tip="Cc-immune" data-game="lol" class="glossary" style="white-space:pre; position:relative;"><a title="Crowd control" href="/wiki/Crowd_control#Immunity"><img height="20" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/b/b1/Cc-immune_icon.png/revision/latest/scale-to-width-down/20?cb=20200327223512" class="lazyload" loading="lazy" data-image-key="Cc-immune_icon.png" width="20" data-image-name="Cc-immune icon.png" decoding="async" data-relevant="0" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" alt="Cc-immune icon"></a> <a title="Crowd control" href="/wiki/Crowd_control#Immunity">crowd control immunity</a></span>, stopping upon hitting an enemy champion. He then <span data-tip="Knockdown" style="white-space:pre; position:relative;" class="glossary" data-game="lol"><a title="Knockdown" href="/wiki/Knockdown"><img width="20" data-image-name="Knockdown icon.png" loading="lazy" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/a/ae/Knockdown_icon.png/revision/latest/scale-to-width-down/20?cb=20171201223937" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" class="lazyload" alt="Knockdown icon" decoding="async" height="20" data-image-key="Knockdown_icon.png" data-relevant="0"></a> <a title="Knockdown" href="/wiki/Knockdown" class="mw-redirect">knocks them down</a></span> and <span data-game="lol" class="glossary" data-tip="Channel" style="white-space:pre; position:relative;"><a href="/wiki/Channel" title="Channel"><img loading="lazy" data-image-name="Channeling icon.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" class="lazyload" decoding="async" alt="Channeling icon" width="20" height="20" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/b/bb/Channeling_icon.png/revision/latest/scale-to-width-down/20?cb=20180628192319" data-image-key="Channeling_icon.png"></a> <a title="Channel" href="/wiki/Channel">channels</a></span> for up to 1.<small>5</small> seconds to <span class="glossary" data-game="lol" style="white-space:pre; position:relative;" data-tip="Suppression"><a href="/wiki/Types_of_Crowd_Control#Suppression" title="Types of Crowd Control"><img height="20" width="20" data-image-name="Suppression icon.png" data-image-key="Suppression_icon.png" loading="lazy" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/5/5f/Suppression_icon.png/revision/latest/scale-to-width-down/20?cb=20171201223943" data-relevant="0" class="lazyload" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" alt="Suppression icon" decoding="async"></a> <a href="/wiki/Types_of_Crowd_Control#Suppression" title="Types of Crowd Control">suppress</a></span>, <span style="white-space:pre; position:relative;" class="glossary" data-game="lol" data-tip="True sight"><a title="Sight" href="/wiki/Sight#True_sight"><img alt="True Sight icon" class="lazyload" width="20" loading="lazy" height="20" data-image-name="True Sight icon.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/1/18/True_Sight_icon.png/revision/latest/scale-to-width-down/20?cb=20150808161653" data-image-key="True_Sight_icon.png" decoding="async" data-relevant="0"></a> <a title="Sight" href="/wiki/Sight#True_sight">reveal</a></span>, and deal <span style="color: #00B0F0; white-space:normal">magic damage</span> every 0.<small>25</small> seconds, <span style="white-space:pre; position:relative;" data-game="lol" class="glossary" data-tip="Sight"><a href="/wiki/Sight" title="Sight"><img data-relevant="0" class="lazyload" loading="lazy" data-image-name="Sight icon.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" decoding="async" width="20" data-image-key="Sight_icon.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/0/0e/Sight_icon.png/revision/latest/scale-to-width-down/20?cb=20130928145820" alt="Sight icon" height="20"></a> <a title="Sight" href="/wiki/Sight">revealing</a></span> himself in the process.',
