          '<i>Infinite Duress</i> applies <span class="glossary" data-tip="On-hit" style="white-space:pre; position:relative;" data-game="lol"><a title="Attack effects" href="/wiki/Attack_effects#On_Hitting"><img data-relevant="0" width="20" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/75/On-hit_icon.png/revision/latest/scale-to-width-down/20?cb=20201114055106" loading="lazy" alt="On-hit icon" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" decoding="async" height="20" data-image-name="On-hit icon.png" data-image-key="On-hit_icon.png" class="lazyload"></a> <a title="Attack effects" href="/wiki/Attack_effects#On_Hitting">on-hit</a></span> effects 3 times and <span style="white-space:nowrap"><a title="Life steal" href="/wiki/Life_steal"><img src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/76/Life_steal_icon.png/revision/latest/scale-to-width-down/15?cb=20170515203537" loading="lazy" data-image-name="Life steal icon.png" decoding="async" height="15" width="15" data-image-key="Life_steal_icon.png" data-relevant="0" alt="Life steal icon" class="lazyload"></a>&nbsp;<span style="color: #CC2051; white-space:normal">life steal</span></span>.',
