        description:
          '<i><span data-ability="Primal Howl" data-param="" style="display:inline;white-space:pre;" data-champion="Warwick" data-game="lol" class="inline-image label-after ability-icon"><span style="display:inline-block;position:relative;" class="border" data-width="20"><a href="/wiki/Warwick/LoL#Primal_Howl" title="Primal Howl"><img decoding="async" data-image-key="Warwick_Primal_Howl.png" height="20" alt="Primal Howl" data-image-name="Warwick Primal Howl.png" loading="lazy" class="thumbborder lazyload" data-relevant="0" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/9/92/Warwick_Primal_Howl.png/revision/latest/scale-to-width-down/20?cb=20170818011956" width="20"></a></span> <span style="white-space:normal;"><a href="/wiki/Warwick/LoL#Primal_Howl" title="Warwick/LoL">Primal Howl</a></span></span> can be cast during the dash.</i>',
